import './MyApp.css';
import logo from './dccs.png';
import {FiSearch} from 'react-icons/fi';
import ApplicantInfo from './ApplicantInfo.js';
//import Client from './Client';


class ApplicantList extends React.Component {
	constructor(props){
		super(props);
		this.state = {applicants: []}; //array of applicants
		//this.client = new Client();
		//this.client.clientResult().then(r =>this.setState({names:r}));
	}

  render(){
	let applInfo1 = { 
			name: "Almir Omerovic",
			placeOfEmployment: "DCCS, Tuzla",
			addres: "Moluhe,7500 Tuzla",
			};
	let applInfo2 = { 
			name: "Ina Golos",
			placeOfEmployment: "CA, Tuzla",
			addres: "Stupine,7500 Tuzla",
			};
	let infos = [applInfo1,applInfo2];
	this.state.applicants = infos;
    return(
      <div id="mainListDiv">
        <p> Showing results in my app </p>
        {this.state.applicants.map(a => <ApplicantInfo info={a}/>)}
      </div>
    );
  }
}

class SearchBar extends React.Component {
