          <spam><FiSearch/></spam>
          <input id="searchInput" type="text"/>
        </div>
      </div>
    );
  }
}

class MyApp extends React.Component {
  render(){
    return(
      <div id="mainDiv">
        <SearchBar />
        <ApplicantList />
      </div>
    );
  }
}

